  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112884 includes chemical,
  discrete sample, physical and time series profile data collected from POLARFRONT
  in the Norwegian Sea from 2001-10-31 to 2007-11-29. These data include ALKALINITY,
  DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE, PHOSPHATE,
  SALINITY, SILICATE and WATER TEMPERATURE. The instruments used to collect these
  data include Alkalinity titrator, CTD, Coulometer for DIC measurement and bottle.nnThese
  data were collected by Francisco Rey of Institute of Marine Research - Hvitsten,
  Norway and Ingunn Skjelvan and Svein Osterhus of University of Bergen; Bjerknes
  Center for Climate Research; Geophysical Institute as part of the OWS_M_66N_2E data
  set. CDIAC assigned the following cruise ID(s) to this data set: OWS_M_66N_2E.nnThe
  Global CO2 Time-series and Moorings Project involves international groups from 18
  countries who have mounted sensors on moored buoys to provide high resolution time-series
  measurements of atmospheric boundary layer and surface ocean CO2 partial pressure
  (pCO2). The CO2 Time-series and Moorings Project is coordinated by UNESCO International
  Ocean Carbon Coordination Project (IOCCP).\",\n\t\"license_title\": null,\n\t\"extras\":
